INSERT INTO `course` (`id`, `name`, `content`, `eligibility`, `duration`, `fees`, `hod`, `hodfoto`) VALUES
('bba', 'B.B.A. (Bachlors of Business Administration)', '\r\nThe BBA course is aimed at providing a management degree to students who are aspiring \r\nfor a career as managers and who wish to become an MBA subsequently.\r\n<br />\r\nThe BBA program develops capable problem-solvers and decision-makers.\r\n<br />\r\nIt provides a fundamental grounding in administration and offers an opportunity to pursue a wide range of interests.\r\n<br />\r\nSuccessful completion of BBA would make a student eligible for admission to MBA program.\r\n<br />\r\nA wide exposure and linkage with industry.\r\n<br />\r\nThe program provides a wide range of choices to the student entering into an attractive employment.\r\n<br />\r\nIncorporates various professional skills and value focused decision making along with the regular teaching.\r\n<br />\r\nA broad professional and technical knowledge.\r\n<br />\r\nAfter the course you are eligible for MBA, MCA.', '12th pass', '3 years (six semesters)', '9000', 'Bankim Trivedi', 'images/teachers/bankimtrivedi.jpg'),
('bca', 'Bachelor of Computer Application (B.C.A.)', '<b>Were changing the world with technology  - Bill Gates\r\n</b>\r\n<br />\r\n<b>Once a new technology rolls over you, if youre not part of the steamroller, \r\nyoure part of the world  - Stewart Brand\r\n</b>\r\n<br />\r\nThe Bachelor of Computer Applications or BCA is a three year undergraduate program. \r\n<br />\r\nBCA is designed to produce graduates who have the necessary skills & knowledge not only in computer and information technology, but also in communication, organization and management .\r\n<br />\r\nBCA course will develop the scope for all streams student to get job in IT industry since they will be able to develop software programming skills.\r\n<br />They can also do MCA / M.Sc.(IT & CA) / MBA course after completion of the BCA course, which will enable them to get job in top-rated IT companies like Infosys, TCS, Wipro, Reliance etc.\r\n', '12th Pass ', '3 years (six semesters)', '12000', 'Prashant Dave', 'images/teachers/prashantdave.jpg'),
('mscit', 'Master of Science \r\n(Information Technology & Computer Application)\r\n', '&nbsp Master of Science (Information Technology & Computer Application) M.Sc.(IT & CA) is a 2 year Post graduate Degree Program designed mainly to produce technically competent, self motivated and highly productive professionals to meet the growing demand of an ever changing market of the global IT industry. \r\n<br/>\r\nThis course is a professional qualification in IT, which grooms not only IT professionals, but also experts from other domains providing a unique and comprehensive programme.\r\n<br/>\r\nThis program is unique and flexible which allows graduates to build a satisfying career is the challenging fi\r\nThe primary aim is to provide graduates with appropriate practical knowledge, skills, and understanding for managing IT use, change and development.\r\n\r\n\r\n<br/>\r\n<br/>\r\nIntake	:	70  (Admission by Saurashtra University Central Admission Board (SUCAB)  55, Admission by Management  15)\r\n\r\n', 'As per Saurashtra University Central Admission Board (SUCAB) Norms', 'Two years (four semesters) full time course', 'Rs.25000/- (per semester)', 'Asifkhan Yusufzai', 'images/asifkhanyusufzai.jpg'),
('bcom', 'Bachelors of Commerce Course (B.Com.) ', 'Commerce is the engine of our economy\r\n\r\nThe B.Com. program offers in intellectually challenging curriculum that provides with a solid knowledge in business.\r\nThe interdisciplinary nature of the program allows to analyze, formulate the solve challenging business problems.\r\nThe B.Com. program, facilitates study a specific business discipline in greater detail.\r\nThe programme provides a wide range of choices to the student entering into an attractive employment.\r\nA broad professional and technical knowledge\r\nAfter completion of this course you become eligible for MBA & MCA program\r\n', '12th Pass (Commerce)', '3 Years (Six Semester)', 'For  Boys Rs.7200 (Per Semester)\r\n			For Girls Rs.5700 (Per Semester)\r\n', '', ''),
('bed', 'Bachelor of Education (B.Ed.)', 'Teaching is Human Engineering and Soul Doctoring<br/>\r\nTeaching refers to the multiple tasks carried out by teacher for leading the learners to the expected learning.\r\n<br/>\r\nThe relevance of theory course in teacher education programs has been stressed by various commissions, committees and those involved in education. <br/>\r\n<br/>Also plea is made that the situation needs to be remedied by effecting curricular changes in Teacher Education Program. <br/>\r\n<br/><br/>\r\n<b>Course Aims :</b>\r\nAn academically rigorous teacher education. A sound foundation for Developing teaching ability.\r\n\r\n<br/>\r\nIntake		:	B.Ed.  200 (Admission given by Central Admission Committee  170, Admission given by Management  30)\r\n', 'Any Graduate (with minimum 45%)', '2 Years', '17500 per semester', '', ''),
('med', 'Master of Education (M.Ed.)', '<b>Secondary Teachers Training Course (B.Ed.)\r\n</b>\r\n<br>\r\nTwo year training programme, for shaping a graduate into a Secondary Teacher. The college is affiliated to Saurashtra University, Rajkot and approved by Government of Gujarat.\r\n<br>\r\nNational Council for Teacher Education (NCTE), New Delhi, has recognized both the teacher training programmes conduct by this college.\r\n<br>\r\n\r\n<b>Masters of Education (M.Ed.)</b>\r\n\r\n<br>\r\nTwo year programme, for initiating research skills in Teacher Education. <br>\r\nApproval received from NCTE because our B.Ed. programme was Re-Accredited with B Grade (2.76 CGPA) by NCCA. The course is affiliated with Saurashtra University, Rajkot\r\n<br>\r\nIntake        :    40 (Admission given by Central Admission Committee  30, Admission given by Management  10)', 'B.Ed.', '2 Years', '20,000/- per semester\r\n<br>\r\n*Students belonging to SC, ST category get scholarship upto 100% by the Government ', '', ''),
('mca', 'Master of Computer Applications (M.C.A)', 'MCA  Master of Computer Applications is an AICTE approved three years master degree program which is designed to build the skilled professionals with fundamental aspects of computing and technology. The MCA program focuses on providing a sound theoretical background as well as in depth practical exposure to students in the relevant areas of computer.  It is intended to provide a modern, industry-oriented education in applied computer science. \n\nThe primary goal of MCA is to meet the dynamic nature of requirements of IT organizations by producing trained professionals who can successfully meet the demands of information technology industries. After obtaining the degree of MCA, IT professionals can build their career in any areas of IT technology.\nTotal Intake : 120\n', 'Any Graduate', '3 years (6 semesters<br> (2 years for B.C.A. students)', ': 55000 per annum (27500 per semester)', '', ''),
('bsc', 'Bachelor of Science (B.Sc.)', '<strong>Whenever I found out anything remarkable, I have thought it my duty to put down my discovery on paper, so that all ingenious people might be informed thereof.\r\n Antonie van leeuwenhoek <br>\r\nGravity explains the motions of the planets, but it cannot explain who sets the planets in motion. \r\n Sir Isaac Newton <br>\r\n</strong>\r\n<br><br>\r\nThe Bachelor of Science (B.Sc.) is an undergraduate program of 3 years duration (6 semesters). This is the era of exploring basic sciences and to convert it into the advance and applied technologies. As we are one of the fastest growing institutes in science and technology,\r\nwe offer specializations in Microbiology, Chemistry, Physics and Mathematics under the title of B.Sc. Our aim is to give professionally qualified and technically skilled experts to\r\nsociety who can add on into the development of nation India as well as make proud it at world level too. The qualified B.Sc. students can built their carrier as Microbiologist,\r\nResearch scientist, Chemist, Druggist, forensic expert, Astronauts, electronic experts, Defence & space research scientists, Mathematicians. ', '12th Science  ', '6 semesters', 'Rs. 25,000/year', '', ''),
('tirthraj', 'tirthraj', '', '', '', '', '', '');
